    false,nt"url": null,nt"notes": "This narrative report for Long Lake NWR
    outlines Refuge accomplishments from September through December of 1944. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, furbearers, predators, rodents,
    mammals, and raptors- is also covered. The Refuge development and maintenance section
    discusses physical developments and plantings. Resource management is outlined;
    topics include grazing, haying, and fur harvesting. The public relations section
    of the report describes Refuge visitors. N-R forms are attached.",nt"owner_org":
